import React from 'react';
import { useLocation } from 'react-router-dom';
import './ResultPage.css';

function ResultPage() {
  const { state } = useLocation();
  const { data } = state || {};

  if (!data) {
    return <div>No data available</div>;
  }

  return (
    <div className="result-container">
      <h1>Investment Results</h1>
      <h2>Allocation</h2>
      <pre>{JSON.stringify(data.allocation, null, 2)}</pre>
      <h2>Market Evaluation</h2>
      <pre>{JSON.stringify(data.market_evaluation, null, 2)}</pre>
      <h2>Selected Assets</h2>
      <pre>{JSON.stringify(data.selected_assets, null, 2)}</pre>
    </div>
  );
}

export default ResultPage;
